
  
function getNationsLinechart() {
    $('#mapchartdropdowns').empty()
    $('#mapchartdropdowns').append(`<div class="row m-0">
    <div class="col-lg-12 col-md-12 col-sm-12 col m-o p-0">
      <h4 id="line-nation-title">GDP and Child Mortality rates</h4>
    </div>
    <div id="nations-button-linechart" class="col-lg-12 col-md-12 col-sm-12 col p-0"></div>
    <div id="parent1" class="col-lg-12 col-md-12 col-sm-12 col  p-0">
    </div>
    <div id="parent2" class="col-lg-12 col-md-12 col-sm-12 col  p-0">
    </div>
    <div class="card"><div class="card-body"><h3 class="card-title">Download datasets used in this visualization</h3><a class="btn btn-primary" href="datasets/gdp_life_mortality.zip" download>Download .zip file (.json, .csv)</a></div></div>
  </div>`)
    $('#nations-button-linechart').empty()
    $('#nations-button-linechart').append(`
    <div class="dropdown">
    <button class="btn btn-info dropdown-toggle" type="button" id="dropdownMenu2" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
      Choose nation
    </button>
    <div id="nations-linechart" class="dropdown-menu" aria-labelledby="dropdownMenu2">
  
    </div>
  </div>`)
    $.getJSON('js/ngdp.json',function(jsondata){
      var nations = Object.keys(jsondata)
      console.log(nations)
      $.each(nations, function(idx, n) {
        $('#nations-linechart').append(`
        <button onclick="graphMortality('${n}'); graphGDP('${n}');" class="dropdown-item" type="button">${n}</button>
        `)
      })
    })
    graphMortality('Italy');
    graphGDP('Italy');
  }


